import { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import UserList from "./UserList ";
import axios from "axios";

function SetAdmin() {
  const navigate = useNavigate();
  useEffect(() => {
    let url = "/userinfo";
    const fetchData = async () => {
      const result = await axios.get(url);
      //유저 정보가 존재하지 않을경우 로그인 페이지
      if (
        result.data === "" ||
        result.data.userProfileId.userAccount === "" ||
        result.data.userProfileId.userAccount === undefined ||
        result.length === 0
      ) {
        navigate("/login");
      } else {
        setUserInfo(result);
        setUserPic(result.data.userProfilePicPath);
        setUserIsAdmin(result.data.userIsAdmin);

        console.log(result);
      }
    };
    fetchData();
  }, []);

  return (
    <div>
      <div className="set_admin_box">
        <div className="set_admin_title">관리자 설정</div>
        <div className="set_admin_contents">사용자 목록</div>
        <UserList />
      </div>
    </div>
  );
}
export default SetAdmin;
